import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsxRuntime classic */
/* @jsx mdx */
import { Playground, Props } from 'docz';
import 'antd/dist/antd.css';
import { Form, InputNumber, Input, Radio, Modal, Button, message} from 'antd';
import EditModal from './EditModal';


const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "editmodal"
    }}>{`EditModal`}</h1>
    <p>{`EditModal是EditForm结合弹窗使用的封装。`}</p>
    <p>{`EditModal为你处理了`}</p>
    <ul>
      <li parentName="ul">{`窗口标题`}</li>
      <li parentName="ul">{`窗口显示隐藏的控制`}</li>
    </ul>
    <h2 {...{
      "id": "示例"
    }}>{`示例`}</h2>
    <h3 {...{
      "id": "默认"
    }}>{`默认`}</h3>
    <p>{`表单的详细使用方法请参考`}<inlineCode parentName="p">{`EditForm`}</inlineCode></p>
    <Playground __position={0} __code={'class Demo extends React.Component {\n    constructor(props) {\n      super(props)\n      this.state = {\n        visible: false,\n        source: null,\n        updateFunction: null,\n      }\n    }\n    addFunction(value) {\n      return fetch(\'./add\')\n    }\n\n    updateFunction(value) {\n      Modal.confirm({\n        title: \'编辑\',\n        content: JSON.stringify(value),\n      })\n      return fetch(\'./update\')\n    }\n\n    render() {\n      const { visible, source, updateFunction } = this.state\n      return (\n        <div>\n          <Button\n            style={{ marginRight: 10 }}\n            onClick={() => {\n              this.setState({\n                visible: true,\n                source: null,\n                updateFunction: null,\n              })\n            }}\n          >\n            新增\n          </Button>\n          <Button\n            style={{ marginRight: 10 }}\n            onClick={() => {\n              this.setState({\n                visible: true,\n                source: { id: 1, nickName: \'aa\' },\n                updateFunction: this.updateFunction,\n              })\n            }}\n          >\n            编辑\n          </Button>\n          <Button\n            onClick={() => {\n              null\n              this.setState({\n                visible: true,\n                source: { id: 1, nickName: \'aa\' },\n                updateFunction: null,\n              })\n            }}\n          >\n            查看\n          </Button>\n          <EditModal\n            editFormProps={{\n              source,\n              addFunction: this.addFunction,\n              updateFunction,\n              formItemList: [\n                {\n                  name: \'nickName\',\n                  label: \'姓名\',\n                  content: <Input />,\n                  rules: [\n                    {\n                      required: true,\n                      message: \'请填写姓名\',\n                    },\n                  ],\n                },\n                {\n                  name: \'age\',\n                  label: \'年龄\',\n                  content: <InputNumber />,\n                },\n              ],\n              onCancel: () => {\n                message.info(\'取消\')\n              },\n              onError: () => {\n                message.error(\'保存出错\')\n              },\n              onOk: () => {\n                message.success(\'保存成功\')\n              },\n            }}\n            visible={visible}\n            close={() => this.setState({ visible: false })}\n          />\n        </div>\n      )\n    }\n  }'} __scope={{
